import React from "react"

function Node() {
    const style = {
        width: 500,
        height: 500,
        lineHeight: 500,
        borderRadius: "50%",
        fontSize: 50,
        color: "#fff",
        textAlign: "center",
        background: "black"
    }

    let value = 10;
    
    return (
        <div className={style}>{value}</div>
    )
}

export default Node
